import React from 'react';
import Fertilizers from './Components/Fertilizers/Fertilizers';
import Header from './Components/Layout/Header';
import Cart from './Components/Cart/Cart';


const App = () => {
  return (
    <React.Fragment>
      <Header />
      <Cart />
      <main>
        <Fertilizers />
      </main>
    </React.Fragment>
  );
}

export default App;
